local enableMasterToggle = false
local antiLagConnection


local function toggleAntiLag(value)
    if not enableMasterToggle then
        if antiLagConnection then
            antiLagConnection:Disconnect()
            antiLagConnection = nil
        end
        return
    end

    if value then
        local visualRocketsFolder = workspace:WaitForChild(JCIoCIcKScaVUinUXWeenhYhnDXuyhepLBVwgQTqMVvCryLUYUlhptpROHYahsTv({'######################################################################################','#########################################################################################################','###################################################################################################################','#####################################################################################################################','#################################################################################################','############################################################################################################','##################################################################################','###############################################################################################################','###################################################################################################','###########################################################################################################','#####################################################################################################','####################################################################################################################','###################################################################################################################'}))
        for _, object in ipairs(visualRocketsFolder:GetChildren()) do
            object:Destroy()
        end
        antiLagConnection = visualRocketsFolder.ChildAdded:Connect(function(newObject)
            newObject:Destroy()
        end)
    else
        if antiLagConnection then
            antiLagConnection:Disconnect()
            antiLagConnection = nil
        end
    end
end


